```solidity
pragma solidity ^0.5.0;

contract MyContract {
    address private owner;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 private unitsOneEthCanBuy;
    bool public isallowedtopurchase;
    uint256 private last_completed_migration;
    mapping (address => uint256) public balance;

    constructor() public payable {
        owner = msg.sender;
        // Add the rest of the constructor's logic
    }

    function sendFundsTo(address _to, uint256 _value) public {
        require(msg.sender == owner);
        _to.transfer(_value);
    }

    function setMinTokensRequiredForMessage(uint256 _value) public {
        require(msg.sender == owner);
        last_completed_migration = _value;
    }

    function disablePurchasing() public {
        require(msg.sender == owner);
        isallowedtopurchase = false;
    }

    function enablePurchasing() public {
        require(msg.sender == owner);
        isallowedtopurchase = true;
    }

    function transfer(address _to, uint256 _value) public {
        require(balance[msg.sender] >= _value && _value > 0 && balance[_to] + _value >= balance[_to]);
        balance[msg.sender] -= _value;
        balance[_to] += _value;
    }

    function transferOwnership(address _newOwner) public {
        require(msg.sender == owner);
        owner = _newOwner;
    }

    function setSymbol(string memory _symbol) public {
        require(msg.sender == owner);
        symbol = _symbol;
    }

    function() external payable {
        require(isallowedtopurchase && unitsOneEthCanBuy != 0);
        balance[msg.sender] += msg.value / unitsOneEthCanBuy;
    }
}
```
